#
# Very bad brute force algorithm. There is no need to count all incoming and outgoing
# connections. The moment i know j => return False because i cannot be a celebrity.
# Or the moment j does not know i => return False because i cannot be a celebrity.
# That's the reason this algorithm fails for the last test case.
#

# The knows API is already defined for you.
# return a bool, whether a knows b
# def knows(a: int, b: int) -> bool:

# Algorithm (A): Highly inefficient Brute Force algorithm!
class Solution:
    def findCelebrity(self, n: int) -> int:
        hsh = dict()
        for i in range(n):
            indegree, outdegree = 0, 0
            for j in range(n):
                if j != i:
                    if (i, j) not in hsh:
                        hsh[(i, j)] = knows(i, j)
                    outdegree += hsh[(i, j)]
                    if (j, i) not in hsh:
                        hsh[(j, i)] = knows(j, i)
                    indegree += hsh[(j, i)]
            if indegree == n - 1 and outdegree == 0:
                return i
        return -1

# Algorithm (B): Much better Brute Force algorithm! Early exit upon confirmation.
#                This one passes the OJ despite being relatively slow.
class Solution:
    def findCelebrity(self, n: int) -> int:
        def is_celebrity(i):
            for j in range(n):
                if j == i:
                    continue
                if knows(i, j) or not knows(j, i):
                    return False
            return True
        for i in range(n):
            if is_celebrity(i):
                return i
        return -1

# Algorithm (C): Optimized algorithm based on logical deduction
class Solution:
    def findCelebrity(self, n: int) -> int:
        def is_celebrity(i):
            for j in range(n):
                if j == i:
                    continue
                if knows(i, j) or not knows(j, i):
                    return False
            return True
        possible_celebrity = 0
        i = possible_celebrity + 1
        while i < n:
            if knows(possible_celebrity, i):
                possible_celebrity = i
                i = possible_celebrity + 1
            else:
                i += 1
        if is_celebrity(possible_celebrity):
            return possible_celebrity
        else:
            return -1

# Algorithm (D): Optimized algorithm based on logical deduction - same as (C)
#                but using a for loop instead of the while loop. TC: O(n), SC: O(1)
class Solution:
    def findCelebrity(self, n: int) -> int:
        def is_celebrity(i):
            for j in range(n):
                if j == i:
                    continue
                if knows(i, j) or not knows(j, i):
                    return False
            return True
        possible_celebrity = 0
        for i in range(1, n):
            if knows(possible_celebrity, i):
                possible_celebrity = i
        if is_celebrity(possible_celebrity):
            return possible_celebrity
        else:
            return -1



